import React, { Fragment } from "react";
import Fiction from "./Fiction";

const BookBar = props => {
  return (
    <Fragment>
      <div className="Card">
        {props.nextFour.map(book => (
          <Fiction key={book.id} book={book} />
        ))}
        <button onClick={props.moreBooks}>More Books!</button>
      </div>
    </Fragment>
  );
};

export default BookBar;
